`),new:["**Omnisearch integration** - Full-text search support when the Omnisearch plugin is installed","**Search provider** setting to switch between file name filter and Omnisearch","==Background colors== for folders and tags: you can now set custom background colors via the context menu (this is also now available in the API)","**New setting**: ==Multi-select modifier==. You can now switch to Option/Alt for multi-select and use Cmd/Ctrl click to open notes in new tab \u{1F389}.","**New setting**: You can now toggle file tags in slim mode. Default is disabled.","**New setting**: You can now toggle text scaling with item height in navigation pane. Default is enabled.","**New languages**: \uD55C\uAD6D\uC5B4 and Polski"],changed:["Hidden tags setting now accepts tag* and *tag name wildcards."],fixed:["Featured image detection now reads frontmatter wikilinks that include embed markers or alias text (for example ![[image.jpg|cover]])","Implemented a fix that should resolve blurred text in Windows caused by rounding errors in subpixel rendering (very rare, only some fonts affected).","Fixed a bug where navigation pane would jump to a tag when a folder with same name was selected."]},{version:"1.4.17",date:"2025-09-15",info:"Welcome to the community release of Notebook Navigator!"},{version:"1.4.16",date:"2025-09-14",info:["No new features or changes in this release. This update focuses on performance and stability improvements, handling edge cases and rare configurations in preparation for the public community release.","==Important!== If you have been using Notebook Navigator through BRAT, **please copy the contents of data.json to a markdown document now to preserve your settings!** When you remove the BRAT version and install the community version, you can paste your settings back to keep pinned notes, colors, icons, custom sort orders and appearances.","**Recommendation**: Use the community version of Notebook Navigator to avoid multiple plugin instances loading when BRAT updates on startup."].join(`

